import React from 'react';
import Systems from '../Systems/Systems';
import { Container } from '@mui/material';
import SystemPage from '../SystemPage/SystemPage';
import {Routes, Route, Outlet} from 'react-router-dom';

import {Device} from '@twilio/voice-sdk'

function Views(props) {

          // Setup Twilio.Device
        const device = new Twilio.Device(data.token, {
            // Set Opus as our preferred codec. Opus generally performs better, requiring less bandwidth and
            // providing better audio quality in restrained network conditions. Opus will be default in 2.0.
            codecPreferences: ["opus", "pcmu"],
            // Use fake DTMF tones client-side. Real tones are still sent to the other end of the call,
            // but the client-side DTMF tones are fake. This prevents the local mic capturing the DTMF tone
            // a second time and sending the tone twice. This will be default in 2.0.
            fakeLocalDTMF: true,
            // Use `enableRingingState` to enable the device to emit the `ringing`
            // state. The TwiML backend also needs to have the attribute
            // `answerOnBridge` also set to true in the `Dial` verb. This option
            // changes the behavior of the SDK to consider a call `ringing` starting
            // from the connection to the TwiML backend to when the recipient of
            // the `Dial` verb answers.
            enableRingingState: true
        });

    return (
        <Container maxWidth='xl'>
            <br/>
            <Routes>
                <Route path='/' element={<div>HOME</div>} />
                <Route path='/manage' element={<div>tamplate for parent of nested routs <br/> <Outlet/></div>}> 
                    <Route path='random path' element={<div>a tamplate for nested route</div>}/>
                    <Route path=':id' element={<div>a tamplate for nested route with params</div>}/>
                </Route>
                <Route path='/systems' element={<Systems/>} />
                <Route path='/systems/:id' element={<SystemPage/>} />
                <Route path='*' element={<div>error 404</div>} />
            </Routes>
        </Container>
    );
}

export default Views;
